INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:WildHarlequin', '{"hd": true, "lines": 10, "title": "Wild Harlequin", "payout": 94.19, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "bonus_buy": true, "identifier": "quickspin:WildHarlequin", "multiplier": 30000, "description": "Welcome to the smoky back tent of an independent circus, where a talented magician owns the stage. But is she really alone up there? Or does she have a twin…?\n\nIt’s all smoke and mirrors in this show. Nothing is what it seems, and everything turns out to be even more fantastical than the card tricks being performed.\n\nCatch this travelling circus while you can, because once this sneaky lady has moved on with her entourage there’s no trace to be seen. Not even a dent in the field. Makes you wonder if it was all a dream…\n\nWild Harlequin is a 5×3 slot with 10 paylines, featuring Wild Harlequin symbols that always nudge to cover the entire reel, plus a Free Spins Bonus with Multiplier magic – and if you hit the BIG win, you’ll know it rea", "identifier2": "wildharlequin94", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "promo", "has_freespins": true, "volatility_rating": "very-high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('pushgaming:fatdrac', '{"hd": true, "lines": 40, "title": "Fat Drac", "payout": 96.57, "devices": ["desktop", "mobile"], "category": "slots", "producer": "pushgaming", "provider": "pushgaming", "identifier": "pushgaming:fatdrac", "multiplier": 50000, "description": "123456\r\nSink your teeth into Fat Drac! The third game in our ‘Fat Series’, with our unique twist on a Vampire theme, that can be enjoyed not only at Halloween, but all year round.\r\n\r\nTake a journey up the steep and winding mountain roads that go all the way up to Fat Drac’s mysterious castle, that’s full of creepy rumbles and mischievous bats flying around.\r\n\r\nFat Drac may not be as terrifying as the Dracula you already know, but don’t be fooled by his cheeky grin. His ever-growing appetite is not easily suppressed and blood goblets must always be in sight.", "identifier2": "id=fatdrac-01&subunits=10", "released_at": "2021-10-14T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["AF", "AS", "AU", "BE", "CU", "DK", "EG", "ER", "ES", "FR", "GB", "GL", "GU", "HK", "IL", "IQ", "IR", "IT", "KP", "KW", "MH", "MM", "MO", "MY", "NG", "NL", "PF", "PL", "PR", "QA", "SD", "SE", "SG", "TW", "US", "VA", "VI", "YE", "ZA", "ZW"]}, "default": {"blacklist": ["AF", "AS", "AU", "BE", "CU", "DK", "EG", "ER", "ES", "FR", "GB", "GL", "GU", "HK", "IL", "IQ", "IR", "IT", "KP", "KW", "MH", "MM", "MO", "MT", "MY", "NG", "NL", "PF", "PL", "PR", "QA", "SD", "SE", "SG", "TW", "US", "VA", "VI", "YE", "ZA", "ZW"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
