INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:SakuraFortune', '{"hd": true, "lines": 40, "title": "Sakura Fortune", "payout": 96.58, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "identifier": "quickspin:SakuraFortune", "multiplier": 1023, "description": "In Sakura Fortune, you step into an enchanted world of cherry blossoms and golden dragons to join the heroine on her journey.\n\nThis extremely volatile 4x5, 40-line slot follows a beautiful Japanese princess as she battles evil emperors on her way to untold riches!\n\nThe game boasts exciting features like Sakura Fortune Respins, Free Spins, and a Mystery Nudge.\n\nWith it''s action-packed, feature-rich gameplay, stunning graphics and lucrative wins, it''s no wonder this game is one of our biggest hits!", "identifier2": "sakurafortune", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:StickyBandits3MostWanted', '{"hd": true, "lines": 9, "title": "Sticky Bandits 3: Most Wanted", "payout": 96.25, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "bonus_buy": true, "identifier": "quickspin:StickyBandits3MostWanted", "multiplier": 22468, "description": "Dynamite, guns, cacti, and whisky the wicked Wild West is back! The first two Sticky Bandit slots are two extremely popular Quickspin games, so who are we to deny you a third one?This time around, the bad-ass bandits are five fierce women and they''ve only got one thing on their mind: to get inside that locked safe and run away with bags full of cash. Will you be able to get your hands on some of it? Sticky Bandits 3 Most Wanted is a 3x5 slot loaded with exciting Wilds and Free Spins, plus the Sticky feature that everyone loves. And you don''t even have to wait around for the Free Spins bonus  pay 60x bet and get instant entry with the Bonus Buy feature!", "identifier2": "mostwanted", "released_at": "2021-05-04T00:00:00.000Z", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:VampireSenpai', '{"hd": true, "lines": 40, "title": "Vampire Senpai", "payout": 96.19, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "identifier": "quickspin:VampireSenpai", "multiplier": 8894, "description": "Get whisked away to a colourful and prosperous world filled with hopping vampires. You heard right! Our July release is inspired by Chinese folklore, where undead creatures, known as the Jiangshi, appear with outstretched arms and stiff posture, preying on humans to absorb their life force.\n\nWe''ve placed a more comedic tone on this traditionally dark theme and packed it with plenty of suspense and anticipation. Included is a base game mystery feature, randomly creating 3-9 additional Talisman Wilds, and it doesn''t stop there. The game gets even darker in Free Spins. After landing one or more Vampire Wilds, the Jiangshi will hop around, sinking their teeth into any Medium human symbol that appears next to them, creating more wilds! Appearing on a 5x5 layout, Vampire Sempai boasts invigorating colour combinations, rich graphics, and eye-catching effects that will leave the player thirsty for more!", "identifier2": "vampiresenpai", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "medium"}');
