INSERT INTO public.external_games_config (game_id, game_data) VALUES ('pushgaming:FireHopper', '{"hd": true, "title": "Fire Hopper", "payout": 96.3, "devices": ["desktop", "mobile"], "category": "slots", "producer": "pushgaming", "provider": "pushgaming", "bonus_buy": true, "identifier": "pushgaming:FireHopper", "multiplier": 50000, "description": "Take a stroll down beautiful country lanes and feast your eyes on a spectacular waterfall that leads to a pond that’s full of unexpected surprises.\r\n\r\nThe setting may be tranquil, however there’s lots of activity going on beside the peacefully still lily pads, buzzing fireflies and singing birds. \r\n\r\nHere, a majestic Fire Frog runs the show. Watch it kick start the action as it hops across the pond, ablaze, changing colours, and leaving behind golden treasures for some flaming wins.", "identifier2": "id=firehopper-01&subunits=10", "released_at": "2021-12-07T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["AF", "AS", "AU", "BE", "CU", "DK", "EG", "ER", "ES", "FR", "GB", "GL", "GU", "HK", "IL", "IQ", "IR", "IT", "KP", "KW", "MH", "MM", "MO", "MY", "NG", "NL", "PF", "PL", "PR", "QA", "SD", "SE", "SG", "TW", "US", "VA", "VI", "YE", "ZA", "ZW"]}, "default": {"blacklist": ["AF", "AS", "AU", "BE", "CU", "DK", "EG", "ER", "ES", "FR", "GB", "GL", "GU", "HK", "IL", "IQ", "IR", "IT", "KP", "KW", "MH", "MM", "MO", "MT", "MY", "NG", "NL", "PF", "PL", "PR", "QA", "SD", "SE", "SG", "TW", "US", "VA", "VI", "YE", "ZA", "ZW"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
