INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:TheWildChase', '{"hd": true, "lines": 25, "title": "The Wild Chase", "payout": 96.73, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "identifier": "quickspin:TheWildChase", "multiplier": 405, "description": "Jump into the fast-paced action of the Wild Chase, where you and your fellow team of thieves are planning one last heist!\n\nSet in a glamorous resort town on the Riviera, the kind of place where the top 1% hang out, this game boasts stunning scenery, super slick graphics and a really exciting gameplay!\n\nThis slot is not only full of jewelry and expensive watches, it''s also full of awesome features. Any win is rewarded with respins, and they continue as long as new wins are added! On top of that, the multiplier Wilds will multiply any win in which they are included.\n\nIf you''re a fan of heist films, you''re going to love this game!", "identifier2": "wildchase", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "medium"}');
