INSERT INTO public.external_games_config (game_id, game_data) VALUES ('quickspin:WildHarlequinbasic', '{"hd": true, "lines": 10, "title": "Wild Harlequin", "payout": 96.27, "devices": ["desktop", "mobile"], "category": "slots", "producer": "quickspin", "provider": "quickspin", "bonus_buy": true, "identifier": "quickspin:WildHarlequinbasic", "multiplier": 30000, "description": "Welcome to the smoky back tent of an independent circus, where a talented magician owns the stage. But is she really alone up there? Or does she have a twin? It''s all smoke and mirrors in this show. Nothing is what it seems, and everything turns out to be even more fantastical than the card tricks being performed.Catch this travelling circus while you can, because once this sneaky lady has moved on with her entourage there'' no trace to be seen. Not even a dent in the field. Makes you wonder if it was all a dream", "identifier2": "wildharlequin", "released_at": "2021-10-12T00:00:00.000Z", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "BY", "CH", "CO", "CY", "CZ", "DE", "DK", "EE", "ES", "FR", "GB", "GR", "HK", "IL", "IT", "LT", "MO", "NL", "PH", "PL", "PT", "RO", "SE", "SG", "UA", "US"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "very-high"}');
