INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:ChiliQuest', '{"hd": true, "lines": 25, "title": "Chili Quest", "payout": 96.15, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 38.89, "producer": "gameart", "provider": "gameart", "identifier": "gameart:ChiliQuest", "multiplier": 1372, "description": "Grab a tequila because it''s time for Chili Quest, from GameArt! If you like things spicy this is the game for you, packed with bright colours and Mexican charm. From a beautiful flamenco dancer and bright pinata to the local donkey, this 5-reel slot is a real fiesta! Meet a sombrero-wearing sugar skull Wild that substitutes for any symbol except the Spicy Pepper and Scatter which is a guitar-playing cactus, 3 of which will reward you with 6 Free Spins. In Free Spins reels 3, 4 and 5 can merge to spin together as one Gigantic Symbol, rewarding an additional 3 Free Spins, with no trigger limit!But all that''s just for starters, because 6 or more Spicy Pepper symbols trigger the Spicy Peppers Respins feature. After paying winning lines, other symbols fade away leaving empty spaces, with only the Spicy Peppers staying for the Respin. Each new Spicy Pepper resets the Respins at 3, and each symbol displays a value, Mini or Major Jackpot. If all the reels fill before Respins run out, a Mega Jackpot is awarded!And, of course there''s an all or nothing red or black card gamble feature, allowing you to double your winnings up to five times.Now that''s what we call a spicy slot!", "identifier2": "208", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "medium"}');
