INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:FortuneTigerHyperWays', '{"hd": true, "title": "Fortune Tiger HyperWays", "payout": 96.3, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 21.6, "producer": "gameart", "provider": "gameart", "bonus_buy": true, "identifier": "gameart:FortuneTigerHyperWays", "multiplier": 15000, "description": "Fortune Tiger HyperWays™ is a high-volatility, cascading 5x4-reel slot game that offers players the chance to\r\nwin up to 15,000x their bet, and up to 60,466,176 ways to win via the HyperWays™ mechanic. Each spin\r\nawards a different-ways-to-win combination depending on the total symbol multipliers (up to x9) that land\r\non each symbol. Wins are attained by landing identical symbols on three or more consecutive reels, counted\r\nfrom left to right, and landing multiple symbols on that reel multiplies that win. Simultaneous wins on\r\ndifferent win-ways are summed up. ", "identifier2": "322", "released_at": "2022-01-25T00:00:00.000Z", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
