INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:ChineseZodiac', '{"hd": true, "lines": 25, "title": "Chinese Zodiac", "payout": 96.1, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 25.54, "producer": "gameart", "provider": "gameart", "identifier": "gameart:ChineseZodiac", "multiplier": 1886, "description": "Are you following us! What is your fortune symbol, what is your element of luck? Take a spin in an amazing 5-reel 25 pay lines, feature filled game of destiny! This is unlike any other game that you will ever play. We wanted your gameplay to be something special, so the features in this game are insanely fun. As the 12 creatures of the Chinese Zodiac are mixed in the pool of pay lines be sure to check out the SECOND CHANCE STACKS FEATURE and open the doors for the animal symbols wheel and let it spin! The dragon roams WILD on the pay lines, completing your combinations with insane wins. The tiger though is always watching, waiting to award your 9, 12 or 15 insane FREESPINS!Follow your fortune!", "identifier2": "195", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:DragonWhisperer', '{"hd": true, "lines": 25, "title": "Dragon Whisperer", "payout": 96.25, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 30.13, "producer": "gameart", "provider": "gameart", "identifier": "gameart:DragonWhisperer", "multiplier": 5074, "description": "Enter a world of fearsome flying beasts in Dragon Whisperer from GameArt! This 5-reel, 25-payline slot is sure to captivate! Meet the brave Dragon Whisperer as she spins as a Scatter, with 3, 4, or 5 triggering 10 Free Spins in which you can win up to 5,000 times your bet! There are 3 types of Free Spin, with the one used decided with the special Free Spins Wheel. Earth Dragon flies over the reels, collecting Wilds вЂ“ which are the dragon eggs symbol. If he gets 3 or more, he''ll randomly drop them back on the reels during the next spin! Fire Dragon flies over the reels, burning Wilds so they move one symbol higher for the next spin. Ice Dragon flies over the reels freezing Wilds in place for the remaining spins. Every spin also features a Bonus Reel. Wins from each spin are subject to the multiplier on the Bonus Reel from 1 to 10 in the base game, from 1 to 10 with 20x in the Free Spins. The Wild symbol is also on the Bonus Reel during the base game - dragons awarding 1 to 3 random Wilds, and a 3x multiplier to the total win. Of course, thereвЂ™s also a red or black card gamble feature, allowing winnings to be gambled up to 5 times.", "identifier2": "209", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
