INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:SpookyGraves', '{"hd": true, "title": "Spooky Graves", "payout": 95.97, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 24.36, "producer": "gameart", "provider": "gameart", "identifier": "gameart:SpookyGraves", "multiplier": 1707, "description": "The mist is rising, the smell of blood thickening. Vampires are emerging from their graves, ready to feast on human blood.\r\n\r\nWe’re celebrating this Halloween with a spooky party in this 5x3-reel slot game with 25 paylines where landing 3+ SCATTERS (Bonus symbols) in the base game triggers the GRAVE DIGGER BONUS round. Many Halloween treats await you here.\r\n\r\nYou can expect rewards such as +1 FREE SPINS up to a maximum of 10 and up to three symbols that act as WILDS in Free Spins. The Wilds display at the top right of the game shows which symbols are acting as Wilds so there’s no mystery surrounding that. Wilds substitute all symbols except Bonus Game symbols (Scatters).\r\n\r\nOnce you’re in Free Spins, landing 3+ Bonus Game symbols awards a retrigger of the Grave Digger Bonus game. Each Grave Digger Bonus retrigger is played after the current Free Spin has been completed.\r\n\r\nSpooky Graves also comes with a GAMBLE FEATURE in which winnings can be gambled up to five times.\r\n\r\nA spooky party is unfolding in the graveyard, with all kinds of zombies in attendance. Will you dare to join?", "identifier2": "313", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
