INSERT INTO public.external_games_config (game_id, game_data) VALUES ('gameart:MagicUnicorn', '{"hd": true, "ways": 243, "title": "Magic Unicorn", "payout": 95.97, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 26, "producer": "gameart", "provider": "gameart", "identifier": "gameart:MagicUnicorn", "multiplier": 1516, "description": "Enter the enchanted world of the MAGIC UNICORN with the power of its wild multipliers during free spins. A 5 reels – 243 win ways slot game offers the player the bonus feature where 20, 15 or 10 free spins are awarded with 5, 4 or 3 Moon symbols on adjacent reels from the leftmost reel. During free spins if a Unicorn substitutes in a win on reel 2, the win is multiplied x3 or on reel 4 the win is multiplied x5. If a Unicorn substitutes in a win on both reels 2 and 4, the win is multiplied x15. And as always, landing a series of bonus symbols during the free spins round will land you another set of free spins to play with!", "identifier2": "25", "restrictions": {"default": {"blacklist": ["AU", "BE", "BG", "CY", "DK", "EE", "FR", "GB", "HK", "HR", "IL", "IT", "NL", "NZ", "RO", "SE"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
