INSERT INTO public.external_games_config (game_id, game_data) VALUES ('belatra:BingoSoccer', '{"hd": true, "lines": 100, "title": "Bingo Soccer", "payout": 90.01, "devices": ["desktop", "mobile"], "category": "lottery", "producer": "belatra", "provider": "belatra", "identifier": "belatra:BingoSoccer", "multiplier": 500, "description": "Soccer is one of the most popular sports in the world. People play it in small yards and in huge stadiums, millions of fans watch soccer games in the stands, in sports bars or at home on TV. Plenty of bets are made every day – fans are trying to guess the score, the difference between the goals scored and missed and the time when a certain player may receive a red card ...\n\nYou also love soccer, but you don’t know which team to bet on? Don’t hesitate and choose “Bingo Soccer” from Belatra Games. There is no need to painfully choose what team to cheer for – just place your bet and try to catch the balls with the right numbers! Multilanguage of this online bingo will allow all the people in the world to enjoy this game - among 14 languages of the world everyone will find a suitable one. Besides, this slot also features a super jackpot “The Wheel of Fortune”, and if you decide to play the bingo game online, for free and without registration, you will get a great chance to w", "identifier2": "bingo_soccer", "restrictions": {"default": {"blacklist": []}}, "feature_group": "basic", "has_freespins": false, "volatility_rating": "medium"}');
