INSERT INTO public.external_games_config (game_id, game_data) VALUES ('belatra:BeautyBeast', '{"hd": true, "lines": 40, "title": "Beauty and the Beast", "payout": 95.96, "devices": ["desktop", "mobile"], "category": "slots", "producer": "belatra", "provider": "belatra", "identifier": "belatra:BeautyBeast", "multiplier": 36, "description": "A fairy tale about beautiful Belle and terrible Beast, the master of an incredible castle, is one of those stories that are beloved by more than one generation. This lovely and romantic fairy tale has different versions, it was adapted to many cartoons and movies, and theatrical performances on this theme run all over the world - from France to Broadway. BELATRA Company decided to make a new step in development of this magical story – we created an online video slot based on the fairy tal\"Beauty and the Beast\"!\n", "identifier2": "beauty_beast", "restrictions": {"default": {"blacklist": []}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "medium"}');
