INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:BookofDarkness', '{"hd": true, "lines": 10, "title": "Book of Darkness", "payout": 96.48, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 38.07, "producer": "bsg", "provider": "bsg", "identifier": "bsg:BookofDarkness", "multiplier": 10680, "description": "Uncover the secrets of dark magic in BOOK OF DARKNESS, the latest 10 fixed payline video slot by Betsoft.Look for the mystical books and choose the hero to fight for in the CLASH FOR POWER bonus rounds!When the HUNTRESS and DARK WIZARD symbols align next to a BOOK symbol, the CLASH FOR POWERbegins. Choose your fighter and fill up the HERO METER by receiving wins with your chosen hero. If yourfighter wins, you''ll be rewarded handsomely and start another bonus round.With the unique SHADOWFORM feature, get caught up in the action as the HUNTRESS and DARK WIZARDbattle to magnify your wins. If the DARK WIZARD won the CLASH FOR POWER, he will cause 5 symbols toexpand. If the HUNTRESS won the CLASH FOR POWER, she will award a 5x MULTIPLIER to any and all wins.Prepare yourself for a unique arcane fantasy, only to be found in the BOOK OF DARKNESS. ", "identifier2": "825", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
