INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:EuropeanRoulette', '{"hd": true, "title": "European Roulette", "payout": 97.3, "devices": ["desktop", "mobile"], "category": "roulette", "producer": "bsg", "provider": "bsg", "identifier": "bsg:EuropeanRoulette", "multiplier": 4450, "description": "Roulette is a simple game that gives players the chance to win big.\n\nOur Roulette is based on standard European Standard Single Zero Roulette, according to the standard rules of the Nevada Gaming Commission. An ivory ball circles in the rotating roulette wheel that consists of 36 numbers plus 0. Eventually, the ball stops randomly on one of the 37 random numbers. The player is to predict the outcome of each spin by placing bets in the fields of the Roulette table. Each player wagers against the bank, independently from other game participants.\n\nYour winnings will be based on how well you have predicted the ball’s final resting-place by placing your chips accordingl", "identifier2": "79,275,276,371", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": false}');
