INSERT INTO public.external_games_config (game_id, game_data) VALUES ('belatra:WinShot', '{"hd": true, "lines": 5, "title": "Win Shot", "payout": 91.94, "devices": ["desktop", "mobile"], "category": "slots", "producer": "belatra", "provider": "belatra", "identifier": "belatra:WinShot", "multiplier": 5000, "description": "The history of a gaming machine began a long while, more than 100 years ago, in the United States of America. The first, most simple, slot machines appeared in the bars of San Francisco and very quickly became popular with the city-folks. A few days later, these machines were called \"one-armed bandits.\" \"One-armed\" - because to start the reels you had to pull down a special lever that looked like a hand, and \"bandits\" - because they would rather pump out money from people than let them win. In the future this name only got stronger, since the gambling activity in the US of the 1930s was going side by side with real bandits — gangsters. It happened so that the sound of spinning reels was easily combined with the sound of gun shots ... That prompted BELATRA Company to create a new online slot machine – “Win S", "identifier2": "lt_shot", "restrictions": {"default": {"blacklist": []}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
