INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:Gemmed', '{"hd": true, "ways": 40503, "title": "Gemmed!", "payout": 96.46, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:Gemmed", "multiplier": 21667, "description": "Win with gems of ALL shapes and sizes in GEMMED, the latest slots game by Betsoft. Featuring 40503 ways to win and an innovative reel system, hunting for wins has never been this fun.The game uses a 9x9 grid with special reels that allow for symbols of different sizes. Payouts areawarded via contiguous symbols, which are symbols that touch each other, either adjacent or diagonally. Bigger symbols are worth more as they will pay out ALL payline combinations that pass through them and form a winning combination.There''s always action around the corner. With reels packed with symbols of all values and amazing wilds, you never know when the next win will come around! Look out for the GEM CLUSTERS to trigger the free spins round!Hunt for gems, make it shine and win big in GEMMED!", "identifier2": "811", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
