INSERT INTO public.external_games_config (game_id, game_data) VALUES ('igtech:DragonWilds', '{"hd": true, "lines": 20, "title": "Dragon Wilds", "payout": 96.37, "devices": ["desktop", "mobile"], "category": "slots", "producer": "igtech", "provider": "igtech", "identifier": "igtech:DragonWilds", "multiplier": 7500, "description": "Fly high in Dragon Wilds, the 3x5, 20 lines videoslot. The dragons are always stacked in groups of 2 and when they hit, the multiply the win by 2x. Make your own fortune in the Free Spins where the stacked dragons have a random multiplier up to 15x'' based on your choice!", "identifier2": "vs20dragonwilds", "restrictions": {"default": {"whitelist": ["AU"]}}, "feature_group": "basic", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:BarbaryCoast', '{"lines": 30, "title": "Barbary Coast", "payout": 93.2, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:BarbaryCoast", "multiplier": 243, "description": "This is the REAL Captain Blackbeard and me ruthless band of Pirates, seadog! Climb up the aft and join me hearties as we pillage and plunder along the BARBARY COAST. Hijack ships, search for buried booty, pillage land lubbers gold, and of course kidnap the fair Maiden. Ahhh yes, Captain Blackbeard and me crew have NO mercy in our quest for riches, larceny, and debauchery. Yarrrrrrrr!\n\nFeatures:\nDestroy reel with cannon to turn it BARBARY WILD REEL! Win Free Spins with your trusty Parrot!\nDashing Pick Me Instant Wins and more instant bonus features!\nExperience the excitement of the high seas with the Find the Treasure and Sea Battle Bonus Rounds!", "identifier2": "194,627,628,629", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "low"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:ChilliPop', '{"hd": true, "lines": 25, "title": "ChilliPop", "payout": 96.08, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:ChilliPop", "multiplier": 21667, "description": "Spice things up with Chillipop, the cluster-based, cascading slot game with a secret ingredient: an expanding grid offering explosive new ways to win.From the Mariachi soundtrack to the potent chilli symbols, Chillipop is suffused with the spirit and sizzle of Mexican cuisine. Players try to assemble the perfect salsa, matching symbols like tomatoes, onions, garlic, and red, yellow, and green peppers to create the tastiest (and top-paying) combinations.Like the sauce itself, things can heat up quickly in Chillipop any configuration of 3 or more adjacent symbols pays out, and as items are added to the pot, new symbols cascade down to replace them. Couple this with the wild symbol - which can substitute for any ingredient, as well as creating stackedmultipliers when several appear on-screen and players can create maximum flavour from a single spin.The fiesta gets into full swing with the Free Spins feature, triggered by 3 or more pack mule scatter symbols appearing at once. Over an allocation of between 5 and 26 free spins, Chillipop then uses Betsoft''s proprietary trail system to track the number of sombrero-sporting mules that players collect, with set milestones expanding the size of the cooking pot even further. From an initial 5x3 grid, the Free Spins feature can grow the playing area to a massive 8x8, with the new dimensions dramatically increasing the number of paylines.", "identifier2": "800", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:DrawHiLo', '{"title": "Draw Hi-Lo", "payout": 97.59, "devices": ["desktop"], "category": "card", "producer": "bsg", "provider": "bsg", "identifier": "bsg:DrawHiLo", "multiplier": 3330, "description": "Welcome to Draw Hi-Lo, an exciting, fast-paced card game.\n\nThe goal of the game is to guess whether the next card will be higher or lower than the previous card. If you guess correctly, you can keep playing to win even more or you can cashout at any time and collect your winnings", "identifier2": "74", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": false}');
