INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:NightInParis', '{"lines": 30, "title": "A Night in Paris", "payout": 96.92, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:NightInParis", "multiplier": 500, "description": "Take a breathtaking journey to the fabled City of Lights, straight into the Museum of Paris – where many priceless works of art are just waiting to be nabbed by the entertaining, yet hapless art thief Jacques.\n\nWorking to protect the museum from the thefts is the faithful security guard Jerome LaBaste. Accompanied by his trusty canine friend Pierre, they are bound and determined to stymie this villainous larceny and keep the art where it belongs – the mus", "has_jackpot": true, "identifier2": "351,391,392,393", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
