INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:SingleDeckBlackjack', '{"title": "Single Deck Blackjack", "payout": 99.55, "devices": ["desktop", "mobile"], "category": "card", "producer": "bsg", "provider": "bsg", "identifier": "bsg:SingleDeckBlackjack", "description": "Welcome to multi-hand Single Deck Blackjack.\n\nThis variant is played with a single deck of cards, unlike standard Blackjack, which is played with 6 decks. Each player plays only against the dealer (i.e. the bank), independently of other players. Your goal as the player is to draw cards (i.e. hit) until your hand adds up to 21, or comes as close as possible without exceeding 21.\n\nIf your first two cards total 21, you have Blackjack!", "identifier2": "63,448,449,450", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": false}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:SugarPop2DoubleDipped', '{"hd": true, "title": "Sugar Pop 2: Double Dipped", "payout": 96.42, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:SugarPop2DoubleDipped", "multiplier": 113, "description": "Indulge in the reinvention of Sugar Pop, one of Betsoft''s most popular games. In this incredible sequel, embrace all that was beloved about the original, with cluster wins and candies that explode in a cascade, allowing for additional wins. Revisit the enticing bright colors and welcoming, fluffy, cloud-like dreamland that is the setting of Sugar Pop. But don''t get too comfortable, because things are about to change. In Sugar Pop 2: Double Dipped, everything has been reinvented, from leveling to the candies themselves.", "identifier2": "784,785,786,787", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:DragonKings', '{"hd": true, "lines": 10, "title": "Dragon Kings", "payout": 95.53, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:DragonKings", "multiplier": 5981, "description": "Chinese myths come roaring to life in Dragon Kings, a modern take on a traditional tale, and a 3x5 slot game where the symbols are the real stars. Alongside Asian cornerstones like lucky coins and jade figurines, Dragon Kings reimagines the guardians of ancient China''s seas as four standout, scaly symbols- all of them wild, and each with their own powers and identities.The centre reel is reserved for the eye-catching and even more powerful Dragon King, who builds on the individual dragon''s blessings with his own 2x multiplier. The Dragon King also holds the keys to four tiered jackpots - from bronze to diamond.A special sixth reel contains a magical flaming pearl, which doubles the number of free spins awarded from scatter symbols (up to a possible 30). This symbol is essential for unlocking jackpots, in combination with the Dragon King and one or more of the other dragons.Line up all five dragons and receive a prize fit for a king: 2,000 coins!", "has_jackpot": true, "identifier2": "796", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:FaerieSpells', '{"hd": true, "lines": 10, "title": "Faerie Spells", "payout": 96.03, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:FaerieSpells", "multiplier": 1225, "description": "Uncover the secrets of the undergrowth in Faerie Spells, the 3x5 videoslot where woodland spirits brew potions in the shadows, and any toadstool can hide a hoard of treasure.A traditional alternative to modern fairytales, the symbols in Faerie Spells paint the natural world as a place of uncharted wealth and wonder. Faeries and pixie princesses are joined by wild, green-bearded tree guardians, will the wisps, and glowing, magical trees. The ruler of the realm, the Faerie Queen, can conjure two different features: her aura causes toadstools to reveal their riches, in the form of multiples ofthe player''s bet and three or more of her royal symbols triggers the unique jackpot game.Taking place on a special playfield in the Faerie Queen''s hidden workshop, Betsoft''s signature shared jackpot feature challenges players to collect special potion phials over the course of 10, 15, or 25 free spins. Every drop of potion collected contributes to one of four tiered jackpot recipes being concocted by the queen: the Spells of Plenty, Luxury, Wealth, and Riches. When a symbol is collected, it''s removed fromthe reels and other special symbols cascade down in a magical shower. With Betsoft''s innovative \"Buy-In\" feature, players can pay to trigger the max number of free spins on demand as many times as they like.", "has_jackpot": true, "identifier2": "798", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
