INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:FruitbatCrazy', '{"hd": true, "ways": 243, "title": "Fruitbat Crazy", "payout": 95.22, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:FruitbatCrazy", "multiplier": 1196, "description": "A new slant on traditional slots, Fruitbat Crazy stars a cheeky bat who''s always on the prowl for food - looking to sink his fangs into clusters of melons, berries, citrus fruits and cherries.In Fruitbat Crazy, clusters of low-value symbols always pop first, allowing higher-paying stacks to mount up before splattering them in one big explosion. Unlike other cascading slots, Fruitbat Crazy''s roster of symbols also collapse on a combo-by-combo basis, with smaller wins resolving before triggering their own collapses creating the chance for some seriously succulent payouts.Beyond the 3X5, 243 ways to win base game, Fruitbat Crazy earns its name in the free spins feature: find 3 or more Fruitbat symbols and a whole flock will descend from the trees and gorge themselves over the course of 10 or more free spins.", "identifier2": "804", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:GoldTigerAscent', '{"hd": true, "lines": 10, "title": "Gold Tiger Ascent", "payout": 95.37, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "bonus_buy": true, "identifier": "bsg:GoldTigerAscent", "multiplier": 2520, "description": "Take a journey into the high mountains in GOLD TIGER ASCENT, the latest video slot from Betsoft Gaming! This 3-reel, 3 row video slot, featuring an iconic golden tiger character, pays on 3 of a kind on any payline.\r\n\r\nInnovative functionality allows for MAGIC RED ENVELOPES to appear on the reels, and these ENVELOPES can reveal WILDS, instant cash wins, high value symbols, and even SCATTERS that pay and offer generous FREE SPINS!\r\n\r\nDuring FREE SPINS mode, the MAGIC RED ENVELOPES have even more power: there can be up to 5 ENVELOPES with SCATTERS, and up to 9 ENVELOPES with other symbols! This offers unprecedented chances to win!", "identifier2": "855", "released_at": "2022-01-20T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:LavaGold', '{"hd": true, "title": "Lava Gold", "payout": 95.99, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 29.19, "producer": "bsg", "provider": "bsg", "identifier": "bsg:LavaGold", "multiplier": 159, "description": "Things are about to get hot in LAVA GOLD – the latest 5×5 grid cluster-based game by Betsoft Gaming! With multiple features, including VOLCANO WILDS, FREE SPINS and CLUSTER WINS, the newest slot provides your players with a rich and vivid experience, both graphically and functionally.\n\nLAVA GOLD brings you to a volcanic island, a world of enormous and spine-chilling dinosaurs. Go on a dinosaur egg hunt across the steaming grounds of the archipelago and try not to get caught in the claws of the flying Pterodactyl or the frightening T-Rex! Let the tangles of twigs and leaves guide you to the VOLCANO, which is a WILD symbol!\n\nThe ground shakes as the LAVA METER fills up and FREE SPINS are awarded. During FREE SPINS mode, the central column of the grid will be made up of an identical symbol, guaranteeing a win! Each FREE SPIN during FREE SPINS mode has a growing multiplier. The first FREE SPIN awards a 1x multiplier on wins, and it progresses from there up to a 10x multipli", "identifier2": "823", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:MilesBellhouseAndtheGearsOftime', '{"hd": true, "title": "Miles Bellhouse and the Gears of time", "payout": 96.68, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 19.89, "producer": "bsg", "provider": "bsg", "identifier": "bsg:MilesBellhouseAndtheGearsOftime", "multiplier": 1084, "description": "Miles Bellhouse has been experimenting with Time again! Take a trip of a lifetime and seek out timeless riches with him in this new uniquely crafted 5×5 grid slot by Betsoft where the Past, the Present and the Future provide a new and exciting gameplay experience!\n\nWith every spin, the game will randomly select 5 positions which may be covered by a winning Cluster at the end of each cascade. The more winning Clusters that cover selected positions, the greater chance to trigger one of the special Time Traveling features!\n\nJoin the suspense as Miles Bellhouse finds his way through Past, Present and Future, and magnify your wins with time charged wilds", "identifier2": "834", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
