INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:RiseOfTheMummy', '{"hd": true, "title": "Max Quest: Rise of the Mummy", "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:RiseOfTheMummy", "description": "MAX QUEST transplants the excitement of RNG-based slot gaming into an interactive shooting experience.Every bullet fired towards the shambling hordes has a chance to pay out or trigger a feature, and while Ra’s gauntlet will test players’ nerve, it never tests their aim.A missed shot will either ricochet until it finds a target, or return to the chamber along with its wager.As you progress through the rooms, sinking deeper beneath the sands in search of loot, your party will come toe-to-toe with different tiers of terrifying enemies and accrue an arsenal fit for a Pharaoh.Gem-crusted Scarab beetles scuttle, risen warriors sharpen their weapons, and the god’s own Shadowguard shuffle forward in their funeral sh", "identifier2": "829", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "maxquest", "has_freespins": true}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:StayFrosty', '{"hd": true, "lines": 100, "title": "Stay Frosty!", "payout": 96.21, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "bonus_buy": true, "identifier": "bsg:StayFrosty", "multiplier": 922.48, "description": "Celebrate the holiday season with a warm mug of cocoa and STAY FROSTY! This 5-reel, 100 payline video slot is bursting with holiday cheer and innovative Sticky WILDS that stay Stickyw for 2 spins when part of a winning combination! The Snowman symbol is WILD and varies in size from small to tall!", "identifier2": "851", "released_at": "2021-11-18T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:GoldCanyon', '{"hd": true, "lines": 20, "title": "Gold Canyon", "payout": 96.13, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 37.07, "producer": "bsg", "provider": "bsg", "identifier": "bsg:GoldCanyon", "multiplier": 4774, "description": "Polish your spurs, saddle up and get ready for a pistol-shooting, treasure-hunting & reel-spinning action in Gold Canyon. A dynamite new take on traditional 5X3 video slots.The treasures of Gold Canyon are sure to provide super wins, but even better is theappearance of the MYSTERIOUS DRIFTER, when he spins into the arena, things will get a little more WILD!Watch out for the explosives in the canyon of riches, three or more pieces of DYNAMITE will trigger free spins.Will you be the one to find the treasures of the GOLD CANYON?", "identifier2": "809", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:JumboJoker', '{"hd": true, "lines": 5, "title": "Jumbo Joker", "payout": 95, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:JumboJoker", "multiplier": 3200, "description": "Start hauling in the credits with Betsoft''s fresh, fun take on the classic fruit machine format - JUMBOJOKER!This fast paced, brightly-coloured traditional fruit machine will capture and keep your players'' attention as they go for big MYSTERY WINS in the JUMBO METER mode, which offers higher payouts. The JUMBO METER mode becomes active whenever a win of at least 20 coins occurs on the bottom reels. The winnings from the bottom reels are transferred to the JUMBO METER, where they can either be collected immediately, or used to play on the upper reels, which offer higher wagers and higher payouts.In the best fruit machine tradition, JUMBO JOKER offers a taste of classic fruit iconography and retro-styled audios that will be familiar and comfortable, while the exciting gameplay and high definition graphics brings this classic genre into the modern age.JUMBO JOKER offers players a level of control and strategy that sets it apart from other traditional slot games. By choosing when and how to use the JUMBO METER mode, and the higher payouts it offers, JUMBO JOKER rewards players with a compelling gaming experience and tantalizing wins.", "identifier2": "767,768,769,770", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:MammaMia', '{"lines": 30, "title": "Mamma Mia", "payout": 94.46, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:MammaMia", "multiplier": 6906, "description": "Renowned chef Salvatore welcomes you to his kitchen in Mamma Mia! Take on the role of Salvatore''s Sous-Chef and help him to create wonderful works of culinary art, such as gourmet pizza and panna cotta. But watch out! The cold-hearted food critic, Alberto Ranbomzi, is rumored to visit the restaurant any day now! Will you be able to help Salvatore save the day by helping him to create his perfect dish? Buona Fortuna!", "identifier2": "238,584,585,586", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "low"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:OgreEmpire', '{"hd": true, "lines": 25, "title": "Ogre Empire", "payout": 95.23, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:OgreEmpire", "multiplier": 1192, "description": "Visit a land of magical enchantment, where kingdoms are the home to Kings and Queens, Jokers and an Ogre?!\nIn Betsoft''s newest smash hit OGRE EMPIRE, join the townspeople of a fantasy kingdom with a rather inconvenient Ogre problem! An innovative Day/Night cycle switches up gameplay and allow players to experience what life is like for the people who live in the town.\nDuring the day, the Ogre is awake and active while the townsfolk sleep. And it'' no wonder, as the Ogre will occasionally smash stone symbols, offering extra rewards! Once night falls, the Ogre will drift to sleep and the townsfolk emerge from their stone homes. Only appearing on the reels during night mode, they bring with them royal rewards! Higher payouts aren''t the only benefit of night mode: the Joker emerges as well and brings with him merriment and 2x WILD WINS!\nThe Joker certainly isn''t the only wild find in this kingdom! Both Day and Night offer a special WILD flower blossom. Watch the magic grow and expand, as each flower blossoms and grows or shoots spores, turning other symbols on the reels WILD!\nIn OGRE EMPIRE the struggle is reel and the rewards are nothing short of mythical!", "identifier2": "793", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
