INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:Super7Blackjack', '{"title": "Super 7 Blackjack", "payout": 99.71, "devices": ["desktop", "mobile"], "category": "card", "producer": "bsg", "provider": "bsg", "identifier": "bsg:Super7Blackjack", "description": "Super 7 Blackjack is an exciting multi-hand Blackjack that allows you to play up to 3 simultaneous hands of Blackjack. Each hand plays only against the dealer (i.e. the bank), independently of other hands. Six (6) decks of cards are used to play. Your goal as the player is to draw cards (i.e. hit) until your hand adds up to 21, or comes as close as possible without exceeding 21. If your first two cards total 21, you have Blackjack.\n\nSidebets: The Super 7 bonus side game gives you the chance to win up to an additional 5000.00 depending on what cards you receive.", "identifier2": "44", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": false}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:HatTrickHero', '{"hd": true, "lines": 25, "title": "Hat Trick Hero", "payout": 96.23, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:HatTrickHero", "multiplier": 1260, "description": "Game on! Football season is here. Go for the POWER SHOT and score the winning goal for big prizes in HAT TRICK HERO! With 5 reels, 25 paylines and exciting features, the latest video slot from Betsoft Gaming will put you right in the spotlight of the football field.\n\nWatch out for the special POWER SHOT WILDS, which substitute for all other symbols. Find 3 or more of them on the reels to trigger the HAT TRICK HERO event! During these rounds, any POWER SHOT WILD symbols will move one reel to the left until they have left the reels, potentially stacking up for immense wins.\n\nGet ready for your moment of glory! Each time a POWER SHOT symbol exits the reels, it will raise the SCORE METER by one level. Collect more POWER SHOT symbols to trigger more respins. Collect 15 POWER SHOT symbols to fill the SCORE METER, awarding you with an instant 1000x win.", "identifier2": "832", "released_at": "2021-05-27T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
