INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:SinCityNights', '{"hd": true, "lines": 25, "title": "Sin City Nights", "payout": 93.66, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:SinCityNights", "multiplier": 18640, "description": "Relive those memorable simmering nights spent in the City of Sin with SIN CITY NIGHTS!\n\nThe big bright lights of Las Vegas are brought to you under a pure funk soundtrack in this explosive cascading reels 3D video slot. All sinners welcome.\n\nIt’s time to win big and enjoy your time in SIN CITY NIGHT", "identifier2": "719,720,721,722", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:Stacked', '{"hd": true, "lines": 20, "title": "Stacked", "payout": 96.39, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 39.83, "producer": "bsg", "provider": "bsg", "identifier": "bsg:Stacked", "multiplier": 3847, "description": "Slip into the magic of the reels with Stacked, the latest 4 reel, 20 fixed payline video slot by Betsoft Gaming.The Magician has many tricks and secrets up his sleeve, so keep your eye on him! Featuring a variety offeatures and a dynamic free spins mode, there is plenty of fun to be had!Enjoy the show as the Magician fixes the reels in your favor and lets you look into the Mystery Boxes,which will reward you with FREE SPINS! The deck flips and all reel spots get turned upside down. Before theFREE SPINS mode begins, you will be able to choose your spots on the reels that award unique effects.Powerful magical effects are lurking beneath these spots, if you dare to explore them. Look out for the specialattributes that can enhance your FREE SPINS mode! These attributes can stack and occur together during FREESPINS. Don''t tell anyone. It''s a secret!", "identifier2": "840", "released_at": "2021-03-18T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "low-medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:ThaiBlossoms', '{"hd": true, "lines": 100, "title": "Thai Blossoms", "payout": 96.21, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "bonus_buy": true, "identifier": "bsg:ThaiBlossoms", "multiplier": 922.48, "description": "Discover a lush jungle paradise where the scent of fruit is heavy in the misty air. THAI BLOSSOMS, the latest Betsoft video slot, offers a gorgeous thematic backdrop of Southeast Asia. Luxuriate in a tropical wonderland as you play this exciting new game.\r\nThis 5-reel, 100 payline video slot features stacking WILDS that stay Sticky for 2 spins when occurring on a winning payline. The grand elephant, lord of the fragrant jungle, trumpets triumph in groups of 3 or more, granting access to a generous FREE SPINS mode where the stacking WILDS remain Sticky and persist until the end of the bonus round.", "identifier2": "852", "released_at": "2021-11-11T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:MonsterPop', '{"hd": true, "title": "Monster Pop", "payout": 97.07, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 31.17, "producer": "bsg", "provider": "bsg", "identifier": "bsg:MonsterPop", "multiplier": 1921, "description": "Immerse yourself in the frantic world of MONSTER POP, the latest cluster pays slot by Betsoft Gaming.Collect stacks of monsters, enjoy a variety of features and expand your playing grid to burst your waythrough to AMAZING wins.Featuring eye-popping visuals, MONSTER POP brings fast-paced gameplay with exciting action. Start out your monster adventure with a 5x5 grid that expands with the MONSTER CLONER SYMBOL by duplicating a row, column, or both - and adds WILDS in the mix for extra chances to win!Watch out for special FLAMING SPHERE SYMBOLS, which grant you free spins to keep the action going,with a potential for even more respins. Don''t fret if you don''t get a winning spin, as MONSTER FURY cantrigger at the end of a cascade to create reactions that will spark off big wins!Don''t you dare stop, get ready to MONSTER POP!", "identifier2": "819", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
