INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:SpinfinityMan', '{"hd": true, "lines": 49, "title": "Spinfinity Man", "payout": 95.8, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:SpinfinityMan", "multiplier": 5600, "description": "When crime plagues the streets of Metropolis, SPINFINITY MAN will answer the call! With the help of amazing wild symbols, an arsenal of superpowers and the evil Mr. X to fight against, SPINFINITY MAN is here to become the saviour of the city!\n\nA fun and frivolous take on the golden age of superhero comics, SPINFINITY MAN is a cluster-based, cascading game where groups of more than 4 of the same symbols explode to form winning combinations. SPINFINITY MAN’s randomly-chosen powers are drawn as animated 2×2 symbols – triggering new cascades and launching an avalanche of big wins. Laser eye beams burn away either a full column or a full row of symbols, or both if you find a double beam. Icy breath can freeze and shatter a small or large cluster of symbols. Telepathy will remove all symbols of a single type or colour.\n\nWith his face on every newspaper in town, SPINFINITY MAN has more than his share of admirers. Everywhere he goes – from base game to free spins feature – his dedicated fangirl follows, hopipicture with her idol. When she snaps a photo, a cluster of symbols will pop and trigger an immediate cascade. The fangirl cluster count resets with every new spin – giving SPINFINITY MAN the chance to prove himself (and pose for more selfies) all over again.\n\nWhile solving street-level crime is all in a day’s work for SPINFINITY MAN, a more insidious evil is encroaching on the city! Super villain Mr. X is developing his next dastardly master plan. It’s up to our hero to follow the clues, fill a dedicated Mr. X meter, and catch him red-handed in a city-shaking bonus round! Here the two super humans go head-to-head, but Mr. X has an advantage: he’s replaced all SPINFINITY MAN’s power symbols with his own and increased the odds of them appearing. Get ready for the blockbuster of the summer in SPINF", "identifier2": "807", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
