INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:ReelsofWealth', '{"hd": true, "lines": 10, "title": "Reels of Wealth", "payout": 95.26, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:ReelsofWealth", "multiplier": 674, "description": "Cash in on one of the most exciting new BIG WIN games of 2018 with Reels of Wealth. In this jewel toned, multi-feature new gem from Betsoft Gaming, players try their luck to earn the payday of a lifetime with the innovative new Megastar Jackpot mini game.\n\nThe game itself is built on a “Rolling Wins” platform, awarding players a re-spin every time they win. Compounding the excitement of those free re-spins is the Rolling Wins multiplier, which can award up to three times the payout of a standard win, depending on the number of respins the player has already triggered. In addition to that, instead of a standard wild, Reels of Wealth uses an opulent multiplier wild, which will stack with other wilds for even BIGGER wins. Players also enjoy the luxury of not one but TWO scatter icons. One, the Vault of Wealth, pays immediately. The other – the MEGASTAR JACKPOT symbol -pays players in a much richer fashion.\n\nWhen 3 or more MEGASTAR JACKPOT symbols appear anywhere on the reels the Megastar Jackpot mini-game . The reels change to the special Megastar Jackpot symbols surrounding players with gold and jewels worthy of such a momentous event. Utilizing the proprietary new “Trail System”, the Megastar Jackpot Feature allows players to collect special Jackpot symbols during Free Spins in an attempt to earn one of FOUR incredible jackpots. As the special jackpot symbols fall into place they EXPLODE, allowing other symbols to cascade onto the reels, and advancing their specific Jackpot trail. The Jackpots vary in size, from HERO to STAR to LEGEND to MEGASTAR, each requiring a different number of symbols to reach the GRAND PRIZE. Reels of Wealth gives players so many ways to win, they can bet on a rewarding experience, one way or anot", "has_jackpot": true, "identifier2": "792", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
