INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:ReturntoParis', '{"hd": true, "lines": 20, "title": "Return to Paris", "payout": 96.06, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:ReturntoParis", "multiplier": 1056, "description": "In Paris, there is a museum that holds the world''s treasures. When night falls, these treasures becomevulnerable to the sticky fingers of a notorious Thief, who is crafty and makes off with a treasure each time he visits the museum. But the chase is on - the museum''s Cop is hot on the Thief''s trail!When the Thief and the Cop land adjacently on the reels, a Wild Explosion is triggered, turning all surroundingsymbols to WILDS!The clever game of cat and mouse is played out on the reels, in a constant cycle of steal and return betweenthe Thief and the Cop. When 3 MONA LISA SCATTERS occur on the reels, the open-ended FREE SPINS modebegins, and your players can experience up to 1000 FREE SPINS as the Cop chases the Thief all around thereels! The Cop is always one step closer to his clever quarry.This sequel to our smash hit A NIGHT IN PARIS will have your players glued to their devices, watching theantics of the wily Thief and dedicated Cop ", "identifier2": "847", "released_at": "2021-10-28T00:00:00.000Z", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
