 player’s special candy list, while increasing player enjoyment. Unlike the original, each new level comes with rewards befitting the prestige of leveling up! Also, unlike the original, Sugar Pop 2 has no level cap! With this sweet sequel the fun never has to ", "identifier2": "402,494,495,496", "accumulating": true, "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
