INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:TotalOverdrive', '{"hd": true, "lines": 5, "title": "Total Overdrive", "payout": 96.92, "devices": ["desktop", "mobile"], "category": "slots", "producer": "bsg", "provider": "bsg", "identifier": "bsg:TotalOverdrive", "multiplier": 3206, "description": "Ride a cool rush into a world of neon electronica with this 3 reel, 5 payline video slot. With fresh designs of cherries, bells, diamonds, bars, and 7s, this update of the classic fruit machine with awesome laser effects and a driving soundtrack is sure to inspire nostalgia.The heart of TOTAL OVERDRIVE is the Overdrive Multiplier. Every winning spin will increase themultiplier, and the multiplier will continue to increase with consecutive winning spins. Watch the electric filaments build in intensity with each multiplied win!But it doesn''t end there. The Overdrive Multiplier can also become Sticky. This means it will hold in place for a duration of spins, even if there are no more consecutive wins. The Overdrive Multiplier holdcan even re-trigger while active, pushing the multiplier level and win potential into real overdrive!", "identifier2": "818", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "medium"}');
INSERT INTO public.external_games_config (game_id, game_data) VALUES ('bsg:VikingVoyage', '{"hd": true, "lines": 10, "title": "Viking Voyage", "payout": 96.12, "devices": ["desktop", "mobile"], "category": "slots", "hit_rate": 26.32, "producer": "bsg", "provider": "bsg", "identifier": "bsg:VikingVoyage", "multiplier": 14036, "description": "The soothsayers spoke of great riches across the sea, so the Golden King has gathered his most loyal warriors on their greatest expedition to date. Polish your axe, push out the longboats, and prepare to go looting when VIKING VOYAGE sets sail this spring! Steeped in Scandinavian lore, the reels of VIKING VOYAGE are loaded with royals, runes, and other symbols that spell good fortune for your band of intrepid adventurers: horned helmets, battle-worn axes, golden goblets plundered on past voyages, and god-sent guardians in the form of Odin''s watchful ravens. Joining the Golden King on his fateful voyage are a grizzled village elder, two hardened fighters, and a feisty\nshieldmaiden  all high-paying symbols, and all ready to follow their king to explore new shores in search of untold treasures.\nThe Golden King himself has descended from his throne to lead his people, and he stands proud on reels 1-4 in stacks of up to 3, using his warrior''s instincts to stand in for any other symbol  including the raven scatter. When the King appears in a full-height stack, he bellows a battle cry, freezing that reel in place and shaking the earth so that all other reels spin again. And if another full stack appears during that spin, the King will command that reel to lock, too, before a further respin.\nA special longboat symbol appears only on reels 1 and 5, with shields mounted along its sides, ready to take to the water. When one longboat appears, the drums begin to sound, and if another appears in the same spin, the Vikings being their raid over fifteen free spins!", "identifier2": "805", "restrictions": {"MT": {"blacklist": ["US"]}, "default": {"blacklist": []}}, "feature_group": "standard", "has_freespins": true, "volatility_rating": "high"}');
